INSERT INTO `auction` (`itemID`, `name`, `category`, `currently`, `buy_price`, `first_bid`, `num_bids`, `seller_name`, `city`, `state`, `country`, `latitude`, `longtitude`, `started_date`, `end_date`, `description`, `current_buyer_username`) VALUES
(1, 'Smartphone Samsung Galaxy S6 32GB', 'Smartphones', 360.5, NULL, 328.99, 3, 'acooper1', 'New Haven', 'Connecticut', 'United States', 41.3083, -72.9279, '2016-09-24', '2016-10-07', 'Το νέο Samsung Galaxy S6 είναι γεγονός και ήρθε για να αλλάξει τις ισορροπίες στην κατηγορία των flagship συσκευών, συνδυάζοντας άψογα, υψηλής αισθητικής design, ποιότητα κατασκευής και άρτια τεχνικά χαρακτηριστικά.  Τo λιτό design, αναδεικνύει τις θεσπέσιες καμπύλες του αλλά και την οθόνη 5.1” Super AMOLED με την απίστευτη ανάλυση των 2560 x 1440 pixels (Quad HD). Αν ξεπεράσεις το σοκ που προκαλεί η ανυπέρβλητη εικόνα που είναι σε θέση να αποδώσει, τότε θα εκτιμήσεις δεόντως τον οκταπύρηνο επεξεργαστή, το 64-bit λειτουργικό Android Lollipop, τη δυνατότητα ασύρματης φόρτισης και την κάμερα-τέρας των 16 Megapixel που είναι σε θέση να τραβήξει 4K βίντεο ή Full HD στα 120 fps! Μην το συζητάς: το Galaxy S6 είναι απλά το smartphone των ονείρων σου!', 'mrivera9'),
(2, 'Smartphone Sony Xperia E5 16GB', 'Smartphones', 168.79, NULL, 168.79, 0, 'acooper1', 'New Haven', 'Connecticut', 'United States', 41.3083, -72.9279, '2016-09-24', '2016-10-04', 'Το Sony Xperia E5 είναι το smartphone που συνδυάζει ανθεκτικό σχεδιασμό, επιδόσεις και φανταστική κάμερα!\r\nΠροσφέρει όλα όσα μπορεί να ζητήσει κανείς από μία συσκευή, με απολαυστική 5" οθόνη HD του συνδυάζεται με τις πρωτοποριακές κάμερες 13 & 5 Megapixel για να σου δώσει αξιοζήλευτη ποιότητα εικόνας!\r\nΕντυπωσιακή απόδοση, με μηδενικό πονοκέφαλο. Ξέχνα τις αργές συνδέσεις ή τα smartphone που χάνουν την ενέργειά τους πριν από εσένα. Το Xperia E5 προσφέρει ομαλή λειτουργία μεγάλης διάρκειας και το πιο σημαντικό: απροβλημάτιστη εμπειρία χρήσης!', NULL),
(3, 'Smartphone Huawei Y3 II Dual Sim 8GB', 'Smartphones', 88.99, NULL, 88.99, 0, 'amills8', 'Rochester', 'New York', 'United States', 43.2395, -77.6263, '2016-09-24', '2016-10-04', 'Το Huawei Y3 ΙΙ ήρθε και θα σε κερδίσει με τον όμορφο σχεδιασμό του!\n\n \n\nΕνσωματώνει τετραπύρηνο επεξεργαστή στα 1.10 GHz με 1GB RAM και 8GB εσωτερικής μνήμης, που σε συνδυασμό με το Android 5.1 θα σου προσφέρουν μία ανώτερη εμπειρία χρήσης.\n\nH οθόνη των 4.5" παρέχει ένα ιδανικό περιβάλλον εργασίας για πλοήγηση στο ίντερνετ, αποστολή και λήψη e-mail, όπως και για την άνετη χρήση κάθε λογής app. Τέλος, η ενσωματωμένη κάμερα στην πίσω όψη, σου επιτρέπει να κάνεις λήψη φωτογραφιών 5 Megapixel, ενώ η κάμερα των 2 Megapixel στην μπροστά όψη είναι ιδανική για selfies και βιντεοκλήσεις.', NULL),
(4, 'Smartphone Lenovo A7000 4G Dual Sim 8GB', 'Smartphones', 149, NULL, 149, 0, 'amills8', 'Rochester', 'New York', 'United States', 43.2395, -77.6263, '2016-09-24', '2016-10-05', 'Ψάχνεις για οικονομικό, τετραπύρηνο 4G smartphone με λειτουργία Dual Sim; Tο Lenovo A7000 Dual Sim είναι ακριβώς αυτό που ζητάς! \n\nΗ οθόνη HD IPS wide-view των 5.5 ιντσών, o οκταπύρηνος επεγεργαστής με 2GB RAM, τα διπλά ηχεία με τεχνολογία Dolby Atmos και η υποστήριξη δικτύων 4G LTE, θα μετατρέψουν την καθημερινή σου εργασία και ψυχαγωγία στην πιο ευχάριστη εμπειρία. Το αγαπημένο σου περιεχόμενο θα φαίνεται καλύτερα και θα φορτώνει γρηγορότερα, ενώ η ταυτόχρονη χρήση πολλαπλών εφαρμογών θα εκτελείται άψογα. Τέλος, οι ενσωματωμένες κάμερες 8 & 5 Megapixel θα σου επιτρέψουν να κάνεις λήψη φωτογραφιών, selfie ή video, καθώς και βιντεοκλήσεις.', NULL),
(5, 'Laptop Lenovo 100s-11IBY - 11.6 (Z3735F/2GB/32GB/ HD)', 'Laptops', 230, NULL, 199, 3, 'delliott1', 'Amiens', 'Picardie', 'France', 48.9243, 7.48188, '2016-09-24', '2016-10-08', 'To Lenovo 100s-11IBY είναι ένα laptop ικανό να καλύψει τις ανάγκες του αρχάριου χρήστη καθ'' όλη τη διάρκεια της ημέρας. Χάρη στα άρτια τεχνικά του χαρακτηριστικά, είναι σε θέση να «υπηρετήσει» πιστά τον κάτοχό του, ό,τι απαίτηση κι αν έχει εκείνος, παρέχοντάς του την ισχύ που αποζητά.\r\n\r\nΜέσα του κρύβει έναν επεξεργαστή Intel Atom Z3735F ο οποίος χάρη στους τέσσερις πυρήνες του και το 2 MB μνήμης cache, προσφέρει την απαραίτητη ισχύ. Η DDR3 RAM των 2 GB και ο δίσκος των 32 GB φροντίζουν ώστε η δουλειά σου να γίνει εύκολα και γρήγορα, την ώρα που για τα γραφικά επαρκεί η ενσωματωμένη κάρτα γραφικών Intel HD Graphics . Διαθέτει επίσης άδεια για τα Microsoft Office 365 ώστε να κάνεις με ευκολία τις εργασίες σου στο γραφείο ή στο σπίτι.', 'amills8'),
(6, 'Laptop HP 15-ay007nv - 15.6 (i5-6200U/6GB/256GB/R5 M430)', 'Laptops', 698.85, NULL, 698.85, 0, 'delliott1', 'Amiens', 'Picardie', 'France', 48.9243, 7.48188, '2016-09-24', '2016-10-07', 'Tο HP 15-ay007nv είναι ένα ευέλικτο σύστημα, ικανό να καλύψει τις ανάγκες σου σε γραφείο και σπίτι, προσφέροντάς του επαρκείς υπηρεσίες και ικανοποιητικές επιδόσεις.\r\n\r\n \r\n\r\n Διαθέτει διπύρηνο επεξεργαστή Intel Core i5 6ης γενιάς που πλαισιώνεται από 6 GB μνήμης DDR4, σκληρό δίσκο 256 GB m.2 SSD, ενώ διαθέτει και ανεξάρτητη κάρτα γραφικών AMD. Είναι σε θέση να ταιριάξει σε κάθε τύπο χρήστη, την ώρα που χάρη στο άψογο προφίλ συνδεσιμότητάς του, όπου κι αν το πας, αυτό θα παραμείνει μέσα σ'' όλα! Πρόσθεσε και την οθόνη Full HD και έχεις ένα αν μη τι αλλο αξιοπρόσεκτο σύνολο.', NULL),
(7, 'Laptop Apple MacBook Air MMGF2GR/A - 13.3 (i5/8GB/128GB/HD)', 'Laptops', 1169, NULL, 1169, 0, 'kjacobs0', 'Santa Cruz De Tenerife', 'Canarias', 'Spain', 28.4391, -16.2846, '2016-09-24', '2016-10-10', 'Ο Apple MacBook Air MMGF2GR/A αποτελεί ιδανική επιλογή για εκείνους που αποζητούν ένα αξιόπιστο, ισχυρό και εύκολο στη μεταφορά φορητό σύστημα.\r\n\r\nΔιαθέτει επεξεργαστή Intel Core 5ης γενιάς στα 1.60 GHz και 8 GB DDR3 RAM, υποστηρίζει τεχνολογία ThunderBolt 2 ενώ τα παραπάνω πλαισιώνονται από σκληρό δίσκο τύπου flash (σαν να λέμε SSD) χωρητικότητας 128 GB που θα κάνει το σύστημά σου να «πετάει». Συνυπολόγισε τη μπαταρία με την αυτονομία των 12 ωρών, τη χαμηλή κατανάλωση ενέργειας και το ανθεκτικό unibody περίβλημα αλουμινίου και έχεις ένα κορυφαίο laptop στις υπηρεσίες σου!', NULL),
(8, 'Laptop Apple MacBook Pro MF840GR/A - 13.3 (i5/ 8GB/256GB/Iris 6100)', 'Laptops', 1600.72, NULL, 1600.72, 0, 'kjacobs0', 'Santa Cruz De Tenerife', 'Canarias', 'Spain', 28.4391, -16.2846, '2016-09-24', '2016-10-04', 'Ο Apple MacBook Pro MF840GR/Α αποτελεί ιδανική επιλογή για τον απαιτητικό επαγγελματία που μετακινείται πολύ και αναζητά ένα ισχυρό σύστημα Apple που θα τον βοηθήσει να αυξήσει την παραγωγικότητά του.\r\n\r\nΔιαθέτει διπύρηνο επεξεργαστή Intel Core i5 νέας γενιάς χρονισμένο στα 2.70 GHz και 8 GB DDR3 RAM, υποστηρίζει τεχνολογία ThunderBolt ενώ τα παραπάνω πλαισιώνονται από σκληρό δίσκο τύπου flash (σαν να λέμε SSD) χωρητικότητας 256 GB που θα κάνει το σύστημά σου να «πετάει». Όσο για την οθόνη Retina με την εκπληκτική ανάλυση των 2560x1600, θα σε κάνει να τρίβεις τα μάτια σου με την ποιότητα εικόνας της.', NULL),
(9, 'Monitor TV 22 Samsung LT 22E390EW Full HD', 'TVs', 225.98, NULL, 158.99, 3, 'mrivera9', 'Chicago', 'Illinois', 'United States', 41.8497, -87.6156, '2016-09-24', '2016-10-09', 'Με την Samsung LT 22E390EW Monitor TV 22", απόλαυσε πεντακάθαρη Full HD εικόνα με πολλές λειτουργίες και συνδέσεις για ευελιξία! Λειτουργεί είτε ως οθόνη Η/Υ κορυφαίας απόδοσης είτε ως τηλεόραση Full HD τελευταίας τεχνολογίας, και έχει τη δυνατότητα να αλλάζει εύκολα τη λειτουργίας της από τη μία στην άλλη ανάλογα με την ανάγκη σου. Μπορείς, επίσης, να χρησιμοποιήσεις και τις δύο λειτουργίες την ίδια στιγμή, αφού η δυνατότητα διχοτομημένης προβολής της οθόνης διευκολύνει την αποτελεσματική εκτέλεση πολλαπλών εργασιών.\r\n\r\nΑντίθετα με τις συμβατικές οθόνες, η Samsung LT22E390EW, έχει ευρεία γωνία θέασης 178 μοιρών καθέτως και οριζοντίως, χάρη στο PLS Panel που σου παρέχει απόλυτη ευκρίνεια!', 'amills8'),
(10, 'TV 40 Sony KDL 40RD450 LED Full HD', 'TVs', 389.98, NULL, 389.98, 0, 'mrivera9', 'Chicago', 'Illinois', 'United States', 41.8497, -87.6156, '2016-09-24', '2016-10-09', 'Η τηλεόραση Sony KDL 40RD450 40" LED Full HD με την τεχνολογία επεξεργασίας εικόνας X-Reality PRO θα σου προσφέρει καθηλωτική εικόνα!\r\n\r\n \r\n\r\nΗ Sony αναβαθμίζει κάθε pixel, προσφέροντας εντυπωσιακή ευκρίνεια, και η τεχνολογία βελτίωσης του ρυθμού ανανέωσης της εικόνας Motionflow XR 200 Hz θα σου παρουσιάσει σκηνές ομαλής δράσης χωρίς θολά πλάνα! Χάρισε νέα διάσταση στη λεπτομέρεια HD με την τεχνολογία Clear Resolution Enhancer, μια τεχνολογία μείωσης θορύβου και βελτίωσης εικόνας, η οποία διαφέρει σε μεγάλο βαθμό από την τυπική τηλεόραση LED. Διαθέτει δύο χρήσιμες λειτουργίες HDD Rec & USB Media player και με 2 θύρες HDMI & USB είσαι απόλυτα καλυμμένος!', NULL),
(11, 'Samsung Galaxy Tab E 3G - Tablet 9.6 8GB (SM-T561)', 'Tablets', 99, NULL, 99, 0, 'mrivera9', 'Chicago', 'Illinois', 'United States', 41.8497, -87.6156, '2016-09-24', '2016-10-06', 'Το Samsung Galaxy Tab E 3G διαθέτει κομψό σχεδιασμό και προσφέρει εξαιρετικές επιδόσεις & λειτουργίες σε ανταγωνιστική τιμή, στοιχεία που είναι σε θέση να το αναδείξουν στο ιδανικό tablet για καθημερινή χρήση και μάλιστα on the go, αφού θα σου δώσει τη δυνατότητα να παραμείνεις online μέσω 3G. Διαθέτει μεγάλη οθόνη WXGA 9.6", που σε συνδυασμό με τον ενσωματωμένο τετραπύρηνο επεξεργαστή και το 1.5 GB μνήμης RAM, θα μετατρέψoυν την καθημερινή σου εργασία και ψυχαγωγία σε μία απολαυστική εμπειρία.\r\n\r\nΟι ενσωματωμένες κάμερες 5 & 2 Megapixel, το λειτουργικό Android 4.4 KitKat, η μπαταρία των 5000 mAh, το GPS, αλλά και η δυνατότητα επέκτασης μνήμης έως 128 GB μέσω θύρας microSD συμπληρώνουν ιδανικά τη λίστα των χαρακτηριστικών του Galaxy Tab E και σου δίνουν όχι έναν αλλά πολλούς έξτρα λόγους για να το επιλέξεις!', NULL),
(12, 'Lenovo Tab 2 A10-70L - Tablet 10.1 4G 16GB', 'Tablets', 249, NULL, 249, 0, 'mrivera9', 'Chicago', 'Illinois', 'United States', 41.8497, -87.6156, '2016-09-24', '2016-10-09', 'Το Lenovo Tab 2 A10-70L είναι ένα απίστευτα αξιόπιστο και ισχυρό 4G tablet που θα απογειώσει την οπτική και ηχητική σου εμπειρία! \r\nΠάρε μαζί σου όλες τις αγαπημένες σου ταινίες, τη μουσική και τα παιχνίδια σου και απόλαυσέ τα στο έπακρο, σε οθόνη Full HD IPS wide-view 10.1" με ήχο εξαιρετικής ποιότητας χάρη στην τεχνολογία Dolby Atmos cinematic movie audio. Διαθέτει τετραπύρηνο επεξεργαστή, κάμερες 8 & 5 Megapixel και μπαταρία 7000 mAH για μεγάλη αυτονομία, ενώ τρέχει το Google Android 4.4 KitKat με εγγυημένη αναβάθμιση σε Android 5.0 Lollipop. Όπου και αν βρεθείς, δεν θα μείνεις ποτέ χωρίς multimedia ψυχαγωγία με αυτό το υπερπλήρες αλλά και οικονομικό tablet της Lenovo.', NULL),
(13, 'Laptop Lenovo Full Extra Pokemon HD', 'Laptops', 165.5, NULL, 154.4, 1, 'mrivera9', 'Berlin', '', 'Germany', 52.52, 13.405, '2016-09-30', '2016-10-10', 'FULL EXTRA!!1', 'acooper1');

